import React from 'react';
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import MapIcon from '@material-ui/icons/Map';
import Stepper from '@material-ui/core/Stepper';
import Step from '@material-ui/core/Step';
import StepLabel from '@material-ui/core/StepLabel';
import TextField from '@material-ui/core/TextField';
import InfoIcon from '@material-ui/icons/Info';
import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import PermIdentityIcon from '@material-ui/icons/PermIdentity';
import FormControl from '@material-ui/core/FormControl';
import NoteIcon from '@material-ui/icons/Note';
import { makeStyles } from '@material-ui/core/styles';
import './index.scss';

const useStyles = makeStyles((theme) => ({
  image: {
    backgroundImage: 'url(https://source.unsplash.com/random)',
    backgroundColor:
      theme.palette.type === 'light' ? theme.palette.grey[50] : theme.palette.grey[900],
    backgroundSize: 'cover',
    backgroundPosition: 'center',
  },
  paper: {
    margin: theme.spacing(8, 4),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  logoBig:{
    marginTop: 22,
    marginBottom: 40,
    backgroundColor: '#DEDEDE',
    color: '#FFFFFF',
  },
 loginButton: {
    backgroundColor: '#4E5674',
    borderRadius: 10,
    width: 150,
    height: 50,
  },
  root: {
    width: '100%',
  },

}));

function getSteps() {
  return ['Primer paso', 'Segundo paso', 'Tercer paso', 'Cuarto paso'];
}

export const RegisterFive = () => {
  const classes = useStyles();
  const [activeStep] = React.useState(0);
  const steps = getSteps();

  return (
    <Grid container component="main" className={classes.root}>

      <Grid item xs={false} sm={3} md={3} className={classes.image} />
      <Grid item xs={12} sm={9} md={9} component={Paper} elevation={6} square>
        <div className={classes.paper}>
          <Button variant="contained" className={classes.logoBig}>Logo</Button>

          <Stepper activeStep={activeStep} alternativeLabel>
            {steps.map((label) => (
              <Step key={label}>
                <StepLabel>{label}</StepLabel>
              </Step>
            ))}
          </Stepper>

          <form className={classes.root} noValidate autoComplete="off">
            <div className='complete'>
              <p className='textArr'><NoteIcon className='iconOne'/>Descripción larga del servicio</p>
              <TextField
                label="Descripción larga del servicio"
                multiline
                rows={4}
                defaultValue="Escribe aquí"
                variant="filled"
                className='caja'
              />
              <p className='textAzul'> <InfoIcon/>Máximo 190 carácteres</p>
            </div>

            <div className='complete'>
              <p className='textArr'><NoteIcon className='iconOne'/>Descripción corta del servicio</p>
              <TextField
                label="Descripción larga del servicio"
                multiline
                rows={4}
                defaultValue="Escribe aquí"
                variant="filled"
                className='caja'
              />
              <p className='textAzul'> <InfoIcon/>Máximo 150 carácteres</p>
            </div>

            <div className='complete'>
              <p className='textServ'><PermIdentityIcon/>¿Es un servicio profesional?</p>
              <FormControl component="fieldset">
                <RadioGroup row aria-label="position" name="position" defaultValue="top">
                  <FormControlLabel value="end" control={<Radio color="primary" />} className='radio' label="Sí" />
                  <FormControlLabel value="end" control={<Radio color="primary" />} className='radio' label="No" />
                </RadioGroup>
              </FormControl>
            </div>

            <div className='complete'>
              <p className='textNum'>Número de colegiado</p>
              <TextField
                label="Descripción larga del servicio"
                multiline
                rows={4}
                defaultValue="Escribe aquí"
                variant="filled"
                className='caja'
              />
            </div>

            <div className='complete'>
              <p className='textDesplazarte'>¿Estas en disposición de desplazarte?</p>
              <FormControl component="fieldset">
                <RadioGroup row aria-label="position" name="position" defaultValue="top">
                  <FormControlLabel value="end" control={<Radio color="primary" />} className='radio' label="Sí" />
                  <FormControlLabel value="end" control={<Radio color="primary" />} className='radio' label="No" />
                </RadioGroup>
              </FormControl>
            </div>

            <div className='complete'>
              <p className='textDistan'><MapIcon className='iconOne'/>Distancia</p>
              <TextField
                label="Descripción larga del servicio"
                multiline
                rows={4}
                defaultValue="Escribe aquí"
                variant="filled"
                className='caja'
              /> 
            </div>

            <div className='complete'>
              <p className='textServicios'>¿Puedes prestar servicios en línea?</p>
              <FormControl component="fieldset">
                <RadioGroup row aria-label="position" name="position" defaultValue="top">
                  <FormControlLabel value="end" control={<Radio color="primary" />} className='radio' label="Sí" />
                  <FormControlLabel value="end" control={<Radio color="primary" />} className='radio' label="No" />
                </RadioGroup>
              </FormControl>
            </div>
          </form>

          <div className='login'>
            <Button
              type="submit"
              variant="contained"
              color="primary"
              className={classes.loginButton}
            >
              Sing up
            </Button>  
          </div>
        </div>
      </Grid>
    </Grid>    
  );
}
